  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas web service supports research
  and online mapping activities related to EnviroAtlas (https://enviroatlas.epa.gov/EnviroAtlas).
  The layers in this web service depict ecosystem services at the census block group
  level for the community of Austin, Texas. These layers illustrate the ecosystems
  and natural resources that are associated with clean air (https://enviroatlas.epa.gov/arcgis/rest/services/Communities/ESC_ATX_CleanAir/MapServer);
  clean and plentiful water (https://enviroatlas.epa.gov/arcgis/rest/services/Communities/ESC_ATX_CleanPlentifulWater/MapServer);
  natural hazard mitigation (https://enviroatlas.epa.gov/arcgis/rest/services/Communities/ESC_ATX_NaturalHazardMitigation/MapServer);
  climate stabilization (https://enviroatlas.epa.gov/arcgis/rest/services/Communities/ESC_ATX_ClimateStabilization/MapServer);
  food, fuel, and materials (https://enviroatlas.epa.gov/arcgis/rest/services/Communities/ESC_ATX_FoodFuelMaterials/MapServer);
  recreation, culture, and aesthetics (https://enviroatlas.epa.gov/arcgis/rest/services/Communities/ESC_ATX_RecreationCultureAesthetics/MapServer);
  and biodiversity conservation (https://enviroatlas.epa.gov/arcgis/rest/services/Communities/ESC_ATX_BiodiversityConservation/MapServer),
  and factors that place stress on those resources. EnviroAtlas allows the user to
  interact with a web-based, easy-to-use, mapping application to view and analyze
  multiple ecosystem services for the conterminous United States as well as detailed
  metrics for select communities. Additional descriptive information about each attribute
  in this web service is located within each web service layer (see Full Metadata
  hyperlink) or can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
